import { Typography, TableContainer, Table, TableHead, TableRow, TableCell, TableBody } from "@material-ui/core";

interface BookTableRowProps {
  book: {
    id: number;
    author: string;
    book_name: string;
    quantity: number;
    is_active: boolean;
    is_available: boolean;
    is_delete: boolean;
  };
}

export function BookTableRow({ book }: BookTableRowProps) {
  return (
    <TableRow>
      <TableCell>{book.book_name}</TableCell>
      <TableCell>{book.author}</TableCell>
      <TableCell>{book.quantity}</TableCell>
      <TableCell>{book.is_available ? "Available" : "Not Available"}</TableCell>
    </TableRow>
  );
}

interface BooksTableProps {
  books: {
    id: number;
    author: string;
    book_name: string;
    quantity: number;
    is_active: boolean;
    is_available: boolean;
    is_delete: boolean;
  }[];
  isLoggedIn: boolean;
}

export function BooksTable({ books, isLoggedIn }: BooksTableProps) {
  console.log(books)
  return (
    <>
      <Typography variant="h1">Books</Typography>
      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Book Name</TableCell>
              <TableCell>Author</TableCell>
              <TableCell>Quantity</TableCell>
              <TableCell>Availability</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {books.map((book) => (
              <BookTableRow key={book.id} book={book} />
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </>
  );
}
